import React, { Component } from 'react'

class BaiTapBurger extends Component {


    render() {
        return (
            <div className='container'>
                <h3 className='display-4' text-success> Bài tập burger cybersoft</h3>
            </div>
        )
    }
}

export default BaiTapBurger
